// src/Home.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import './styles/Home.css';

function Home() {
  return (
    <div className="homepage">
      <nav className="navbar">
        <div className="logo">NaviGuía</div>
        <div className="nav-buttons">
          <Link to="/login" className="nav-button">Iniciar Sesión</Link>
          <Link to="/registro" className="nav-button registro">Registrarse</Link>
        </div>
      </nav>

      <header className="hero-section">
        <h1>Muévete con seguridad y confianza</h1>
        <p>Una solución de movilidad para personas con discapacidad visual en Cali</p>
      </header>
    </div>
  );
}

export default Home;
